name = input("Name of area: ")while True:    try:        pm_25 = float(input("Enter Concentration of PM-2.5 (μg/m3): "))        if pm_25 < 0 or pm_25 > 500.4:            print("PM 2.5 value outside range, enter a value between 0 and 500.4")        else:            break    except:        print("PM 2.5 value is not a number, enter a number between 0 and 500.4")while True:    try:        pm_10 = float(input("Enter Concentration of PM-10 (μg/m3): "))        if pm_10 < 0 or pm_10 > 604:            print("PM-10 value outside range, enter a value between 0 and 604")        else:            break    except:        print("PM-10 value is not a number, enter a number between 0 and 604")while True:    try:        no2 = float(input("Enter Concentration of NO2 (ppb): "))        if no2 < 0 or no2 > 2049:            print("NO2 value outside range, enter a value between 0 and 2049")        else:            break    except:        print("NO2 value is not a number, enter a number between 0 and 2049")while True:    try:        so2 = float(input("Enter Concentration of SO2 (ppb): "))        if so2 < 0 or so2 > 1002:            print("SO2 value outside range, enter a value between 0 and 1002")        else:            break    except:        print("SO2 value is sot a number, enter a number between 0 and 1002")    while True:    try:        co = float(input("Enter Concentration of CO (ppm): "))        if co < 0 or co > 50.4:            print("CO value outside range, enter a value between 0 and 50.4")        else:            break    except:        print("CO value is sot a number, enter a number between 0 and 50.4")def AQI_Good(high, low, value):    AQI = ((50-0)/(high-low)*(value-low)+0)    return(AQI)def AQI_Moderate(high, low, value):    AQI = ((100-51)/(high-low)*(value-low)+51)    return(AQI)def AQI_Sensitive(high, low, value):    AQI = ((150-101)/(high-low)*(value-low)+101)    return(AQI)def AQI_Unhealthy(high, low, value):    AQI = ((200-151)/(high-low)*(value-low)+151)    return(AQI)def AQI_Very(high, low, value):    AQI = ((300-201)/(high-low)*(value-low)+201)    return(AQI)def AQI_Hazardous(high, low, value):    AQI = ((500-301)/(high-low)*(value-low)+301)    return(AQI)if pm_25 <= 12:    pm_25_AQI = AQI_Good(12, 0, pm_25)elif pm_25 <= 35.4:    pm_25_AQI = AQI_Moderate(35.4, 12.1, pm_25)elif pm_25 <= 55.4:    pm_25_AQI = AQI_Sensitive(55.4, 35.5, pm_25)elif pm_25 <= 150.4:    pm_25_AQI = AQI_Unhealthy(150.4,55.5, pm_25)elif pm_25 <= 250.4:    pm_25_AQI = AQI_Very(250.4,150.5, pm_25)else:    pm_25_AQI = AQI_Hazardous(500.4,250.5, pm_25)if pm_10 <= 54:    pm_10_AQI = AQI_Good(54, 0, pm_10)elif pm_10 <= 154:    pm_10_AQI = AQI_Moderate(154, 55, pm_10)elif pm_10 <= 254:    pm_10_AQI = AQI_Sensitive(254, 155, pm_10)elif pm_10 <= 354:    pm_10_AQI = AQI_Unhealthy(354,255, pm_10)elif pm_10 <= 424:    pm_10_AQI = AQI_Very(424,355, pm_10)else:    pm_10_AQI = AQI_Hazardous(604,425, pm_10)if no2 <= 53:    no2_AQI = AQI_Good(53, 0, no2)elif no2 <= 100:    no2_AQI = AQI_Moderate(100, 54, no2)elif no2 <= 360:    no2_AQI = AQI_Sensitive(360, 101, no2)elif no2 <= 649:    no2_AQI = AQI_Unhealthy(649, 361, no2)elif no2 <= 1249:    no2_AQI = AQI_Very(1249, 650, no2)else:    no2_AQI = AQI_Hazardous(1250,2049, no2)if so2 <= 35:    so2_AQI = AQI_Good(35, 0, so2)elif so2 <= 75:    so2_AQI = AQI_Moderate(75, 36, so2)elif so2 <= 185:    so2_AQI = AQI_Sensitive(185, 76, so2)elif so2 <= 304:    so2_AQI = AQI_Unhealthy(304, 186, so2)elif so2 <= 604:    so2_AQI = AQI_Very(604, 305, so2)else:    so2_AQI = AQI_Hazardous(1004,605, so2)if co <= 4.4:    co_AQI = AQI_Good(4.4, 0, co)elif co <= 4.9:    co_AQI = AQI_Moderate(9.4, 4.5, co)elif co <= 12.4:    co_AQI = AQI_Sensitive(12.4, 9.5, co)elif co <= 15.4:    co_AQI = AQI_Unhealthy(15.4, 12.5, co)elif co <= 30.4:    co_AQI = AQI_Very(30.4, 12.5, co)else:    co_AQI = AQI_Hazardous(50.4,30.5, co)print("\nAQI for PM25:",round(pm_25_AQI,2))print("AQI for PM10:",round(pm_10_AQI,2))print("AQI for NO2:",round(no2_AQI,2))print("AQI for SO2:",round(so2_AQI,2))print("AQI for CO:",round(co_AQI,2))final_AQI = max(pm_10_AQI, pm_25_AQI, no2_AQI, so2_AQI, co_AQI)if final_AQI <= 50:    q = 'good'elif final_AQI <= 100:    q = 'moderate'elif final_AQI <= 150:    q = 'unhealthy for sensitive groups'elif final_AQI <= 200:    q = 'unhealthy'elif final_AQI <= 300:    q = 'very unhealthy'else:    q = 'hazardous'        print("\nThe AQI in", name, "is", round(final_AQI,2), 'which is',q+".")